      <Container>
<List>
  {Object.keys(trailer.details).map((key) => {
  return <DetailItem key={key} value={trailer.details[key]} name={key} />
})}
</List>
<div>
  <p></p>
  <ul>
    <li>
      <p></p>
      <p></p>
    </li>
  </ul>
</div>
      </Container>
    );
  };
